import React, { PureComponent } from 'react';
import ReactDOM from 'react-dom';
import {Route, HashRouter} from "react-router-dom";

import Header from './components/Template/Header';
import Footer from './components/Template/Footer';
import Dashboard from './components/Dashboard/Dashboard';
import FlotCharts from './components/FlotCharts/FlotCharts';
import MorrisCharts from './components/MorrisCharts/MorrisCharts';
import Tables from './components/Tables/Tables';
import Forms from './components/Forms/Forms';
import PanelsWells from './components/UIElements/PanelsWells';
import Buttons from './components/UIElements/Buttons';
import Notifications from './components/UIElements/Notifications';
import Typography from './components/UIElements/Typography';
import Icons from './components/UIElements/Icons';
import Grid from './components/UIElements/Grid';
import Blank from './components/SamplePages/Blank';

class App extends PureComponent {
    render() {
      return (
          <React.Fragment>  
              <Header />  
              <div id="page-wrapper">  
                  <div className="row">
                      <div className="col-lg-12">
                          <h1 className="page-header" id="pageTitle">Dynamic Page Title</h1>
                      </div>
                      {/* <!-- /.col-lg-12 --> */}
                  </div>  
                    <HashRouter>
                        <div>
                            <Route exact path="/" component={Dashboard}/>
                            <Route path="/flot-charts" component={FlotCharts}/>
                            <Route path="/morris-charts" component={MorrisCharts}/>
                            <Route path="/tables" component={Tables}/>
                            <Route path="/forms" component={Forms}/>
                            <Route path="/panels-wells" component={PanelsWells}/>
                            <Route path="/buttons" component={Buttons}/>
                            <Route path="/notifications" component={Notifications}/>
                            <Route path="/typography" component={Typography}/>
                            <Route path="/icons" component={Icons}/>
                            <Route path="/grid" component={Grid}/>
                            <Route path="/blank" component={Blank}/>
                        </div>
                    </HashRouter>
                  <Footer />  
              </div>
              {/* <!-- /#page-wrapper --> */}                  
          </React.Fragment>
      );
    }
  }

ReactDOM.render(<App />, document.getElementById('root'));
